script: |
  super -f text -I q2641.spq | sort > q2641.out

inputs:
  - name: q2641.spq
    data: |
      SELECT DISTINCT ( col1 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 + - - col2 / - col2 + - col0 * + col1 + + col1 NOT BETWEEN NULL AND - col1 + - col2;
  - name: tab0

outputs:
  - name: q2641.out
    data: |
